Welcome to the fltk-rs book! This is an introductory book targeting the fltk crate . Other resources include: Official Documentation Videos Discussions Examples Demos 7guis-fltk-rs FLTK-RS-Examples Erco's FLTK cheat page , which is an excellent FLTK C++ reference. FLTK is a cross-platform lightweight gui library. The library itself is written in C++98, which is highly-portable. The fltk crate is written in Rust, and uses FFI to call into the FLTK wrapper, cfltk , which is written in C89 and C++11. The library has a minimalist architecture, and would be familiar to developers used to Object-Oriented gui libraries. The wrapper itself follows the same model which simplifies the documentation, since method names are identical or similar to their C++ equivalents. This makes referring the FLTK C++ documentation quite simpler since the methods basically map to each other. int main() { auto wind = new Fl_Window(100, 100, 400, 300, "My Window"); wind->end(); wind->show();
} maps to: fn main() { let wind = window::Window::new(100, 100, 400, 300, "My Window"); wind.end(); wind.show();
} Why choose FLTK? Lightweight. Small binary, around 1mb after stripping. Small memory footprint . Speed. Fast to install, fast to build, fast at startup and fast at runtime. Single executable. No DLLs to deploy. Supports old architectures. FLTK's permissive license which allows static linking for closed-source applications. Themeability (4 supported schemes: Base, GTK, Plastic and Gleam), and additional theming using fltk-theme . Provides around 80 customizable widgets. Has inbuilt image support.

1.body:
Just add the following to your project's Cargo.toml file: [dependencies]
fltk = "^1.2" To use the bundled libs (available for x64 windows (msvc & gnu (msys2)), x64 linux & macos): [dependencies]
fltk = { version = "^1.2", features = ["fltk-bundled"] } The library is automatically built and statically linked to your binary. To make our first Rust code sample work, we need to import the necessary fltk modules: use fltk::{prelude::*, window::Window};
fn main() { let wind = window::Window::new(100, 100, 400, 300, "My Window"); wind.end(); wind.show();
} If you run the code sample, you might notice it does nothing. We actually need to run the event loop, this is equivalent to using Fl::run() in C++: use fltk::{app, prelude::*, window::Window};
fn main() { let a = app::App::default(); let wind = window::Window::new(100, 100, 400, 300, "My Window"); wind.end(); wind.show(); a.run().unwrap();
} We instantiate the App struct, which initializes the runtime and styles, then at the end of main, we call the run() method.

