Non-parented widgets that can no longer be accessed are a memory leak. Otherwise, as mentioned in the previous section all parented widgets lifetimes' are managed by the parent. An example of a leaking widget: fn main() { let a = app::App::default(); let mut win = window::Window::default(); win.end(); win.show(); { button::Button::default(); // this leaks since it's not parented by the window, and has no handle in main }
} A more subtle cause of leaks, is removing a widget from a group, then the scope ends without it being added to another group or deleted: fn main() { let a = app::App::default(); let mut win = window::Window::default(); { button::Button::default(); // This doesn't leak since the parent is the window } win.end(); win.show(); { win.remove_by_index(0); // the button leaks here since it's removed and we no longer have access to it }
}

