To start, you can create a new Rust project using cargo new app. fl2rust is added as a build-dependency to your project: # Cargo.toml
[dependencies]
fltk = "1" [build-dependencies]
fl2rust = "0.4" Then it can be used in the build.rs file (which is run pre-build) to generate Rust code: // build.rs
fn main() { use std::path::PathBuf; use std::env; println!("cargo:rerun-if-changed=src/myuifile.fl"); let g = fl2rust::Generator::default(); let out_path = PathBuf::from(env::var("OUT_DIR").unwrap()); g.in_out("src/myuifile.fl", out_path.join("myuifile.rs").to_str().unwrap()).expect("Failed to generate rust from fl file!");
} We'll be naming our fluid file myuifile.fl. We tell cargo to rerun if that file is changed. We'll create the file in our source directory, but you can put it in its own directory if you wish. We tell the generator to take the fluid file and generate a myuifile.rs. This file is generated in the OUT_DIR, so you won't be seeing it in your src directory. However to include it, you need to create a Rust source file, it can be the same name as our outputted file, and put it in the src directory: $ touch src/myuifile.rs We'll have to import the contents from the auto-generated file using the include! macro: // src/myuifile.rs
#![allow(unused_variables)]
#![allow(unused_mut)]
#![allow(unused_imports)]
#![allow(clippy::needless_update)] include!(concat!(env!("OUT_DIR"), "/myuifile.rs")); Then we'll be able to use the contents in main.rs: // src/main.rs
use fltk::{prelude::*, *};
mod myuifile; fn main() { let app = app::App::default(); app.run().unwrap();
} Now comes the gui part. Open fluid: $ fltk-fluid & #or just fluid if installed from a package manager The ampersand tells our shell to open it as a detached process, so we can still use our shell to compile our code. image We're greeted with an empty window along with a menu bar. Our first step here is to create a Class: image This will popup a dialog, we can leave the name as it is (UserInterface) by clicking Ok. Now you'll see our class listed: image (We've expanded the window) Next, press new again and we'll add a constructor function for our class: image We'll also accept the default name which is make_window(). Next we'll add a window: image A new window pops up, we can enlarge it a bit by dragging the border: image Double clicking the window pops up a dialog where we can change the window's gui properties (under the GUI tab), style (under the Style tab) and class properties (under the C++ tab). image We'll give the window a label My Window in the Gui tab, we'll change the color to white in the Style tab: image And under the C++ tab, we'll give it the variable name my_win: image Our window will now be accessible via myuifile::UserInterface::my_win. We'll add a button by left clicking the window and adding a Button: image This will open the same dialog as before but for the button. Under C++, we'll give it the variable name btn. Under style we'll change the color and label color. Then under Gui we'll give it the label "click me": image We'll drag the border to resize and drag the button to any position we want. Fluid has a layout menu where we can modify a number of widgets (if we had multiple buttons for example) to have the same layout/size ...etc: image We'll now save the file using File/Save As... as myuifile.fl in the src directory. We can now run cargo run to check our build succeeds, but we still haven't call the make_window() method, so we won't see anything yet. Now you can modify src/main.rs to show the window and add a callback to our button: use fltk::{prelude::*, *};
mod myuifile; fn main() { let app = app::App::default(); let mut ui = myuifile::UserInterface::make_window(); let mut win = ui.my_win.clone(); ui.btn.set_callback(move |b| { b.set_label("clicked"); win.set_label("Button clicked"); println!("Works!"); }); app.run().unwrap();
}

