The crate offers an App struct in the app module. Initializing the App struct initializes all the internal styles, fonts and supported image types. It also initializes the multithreaded environment in which the app will run. use fltk::*; fn main() { let app = app::App::default(); app.run().unwrap();
} The run methods runs the event loop of the gui application. To have fine grained control of events, you can use the wait() method. use fltk::*; fn main() { let app = app::App::default(); while app.wait() { // handle events }
} Furthermore, the App struct allows you to set the global scheme of your application using the with_scheme() initializer: use fltk::*; fn main() { let app = app::App::default().with_scheme(app::Scheme::Gtk); app.run().unwrap();
} This will give your application a Gtk app appearance. There are other built-in schemes: Basic, Plastic and Gleam. The App struct is also responsible for loading system fonts at the start of the application using the load_system_fonts() method. A typical fltk-rs application will construct the App struct prior to creating any widgets and showing the main window. Any logic added after calling the run() method, will be executed after the event loop is terminated (typically by closing the all windows of your application, or by calling the quit() method). That logic could include respawning the app if needed. In addition to the App struct, the app module itself contains structs and free functions pertaining to the global state of your app. These include visuals like setting background and foreground colors and default fontface and size, screen functions, clipboard functions, global handlers, app events, channels (Sender and Receiver) and timeouts. Some of these will be discussed elsewhere in the book.

17.body:
FLTK calls the native window on each platform it supports, then basically does its own drawing. This means it calls an HWND on windows, NSWindow on MacOS and an XWindow on X11 systems (linux, BSD). The windows themselves have the same interface as the other widgets provided by FLTK, the WidgetExt trait, which will be discussed in the next page. Lets use what we've seen so far to create a window. use fltk::{prelude::*, *}; fn main() { let app = app::App::default(); let mut my_window = window::Window::new(100, 100, 400, 300, "My Window"); my_window.end(); my_window.show(); app.run().unwrap();
} img1 The new() call takes 5 parameters: x which is the horizontal distance from the left of the screen. y which is the vertical distance from the top of the screen. width which is the window's width. height which is the window's height. title which is the window's title. Next notice the call to end(). Windows, among other types of widgets, implement the GroupExt trait. These widgets will own/parent any widget created between the call begin() (which is implicit here with the creation of the window) and the call end(). The next call show() basically raises the window so it appears on the display. Windows can be embedded inside other windows: use fltk::{prelude::*, *}; fn main() { let app = app::App::default(); let mut my_window = window::Window::new(100, 100, 400, 300, "My Window"); let mut my_window2 = window::Window::new(10, 10, 380, 280, ""); my_window2.set_color(Color::Black); my_window2.end(); my_window.end(); my_window.show(); app.run().unwrap();
} embed Here the 2nd window, my_window2, is embedded inside the 1st window, my_window. We've given it the color black so it appears to us. Notice that its parent is the first window. Creating the 2nd window outside of the parent will basically create 2 separate windows, and will require a call to show(): use fltk::{prelude::*, *}; fn main() { let app = app::App::default(); let mut my_window = window::Window::new(100, 100, 400, 300, "My Window"); my_window.end(); my_window.show(); let mut my_window2 = window::Window::new(10, 10, 380, 280, ""); my_window2.end(); my_window2.show(); app.run().unwrap();
} Windows can also be borderless using the my_window.set_border(false) method. image The set_border(bool) method is part of the WindowExt trait, implemented by all window types in FLTK, in addition to the WidgetExt and GroupExt traits. The list of traits can be found in the prelude module of the crate: docs

18.body:
FLTK offers around 80 widgets. These widgets all implement the basic set of traits WidgetBase and WidgetExt. We've already come across our first widget, the Window widget. As we've seen with the Window widget, widgets can also implement other traits depending on their functionality. Lets add a button to our previous example. use fltk::{prelude::*, *}; fn main() { let app = app::App::default(); let mut my_window = window::Window::new(100, 100, 400, 300, "My Window"); let mut but = button::Button::new(160, 200, 80, 40, "Click me!"); my_window.end(); my_window.show(); app.run().unwrap();
} image Notice that the button's parent is my_window since it's created between the implicit begin() and end() calls. Another way to add a widget is using the add(widget) method that's offered by widgets implementing the GroupExt trait: use fltk::{prelude::*, *}; fn main() { let app = app::App::default(); let mut my_window = window::Window::new(100, 100, 400, 300, "My Window"); my_window.end(); my_window.show(); let mut but = button::Button::new(160, 200, 80, 40, "Click me!"); my_window.add(&but); app.run().unwrap();
} Another thing to notice is the initialization of the button which basically has the same constructor as the Window, that's because it's part of the WidgetBase trait. However, although the Window's x and y coordinates are relative to the screen, the button's x and y coordinates are relative to the window which contains the button. This also applies to our embedded window in the previous page if you hadn't noticed. The button also implements the ButtonExt trait, which offers some helpful methods like setting shortcuts to trigger our button among other methods. Constructing widgets can also be done using a builder pattern: let but1 = Button::new(10, 10, 80, 40, "Button 1");
// OR
let but1 = Button::default() .with_pos(10, 10) .with_size(80, 40) .with_label("Button 1"); Which basically have the same effect. As it stands, our application shows a window with a button, the button is clickable but does nothing! So lets add some action in there in the next page!

19.body:
Button widgets serve multiple purposes and come in several forms: Button RadioButton ToggleButton RoundButton CheckButton LightButton RepeatButton RadioLightButton RadioRoundButton These can be found in the button module. The simplest of which is the Button widget, which basically runs some action when clicked. This applies to all buttons as well: use fltk::{app, button::Button, frame::Frame, prelude::*, window::Window}; fn main() { let app = app::App::default(); let mut wind = Window::default().with_size(400, 300); let mut frame = Frame::default().with_size(200, 100).center_of(&wind); let mut but = Button::new(160, 210, 80, 40, "Click me!"); wind.end(); wind.show(); but.set_callback(move |_| frame.set_label("Hello world")); app.run().unwrap();
} However other buttons can have other value. CheckButton, ToggleButton, LightButton for example hold their current value, i.e. whether they were toggled or not: Radio buttons (RadioRoundButton, RadioLightButton and RadioButton) also hold their value, but only one can be toggled in the parent group (any widget implementing GroupExt). So they are aware of the values of other radio buttons: use fltk::{prelude::*, *}; fn main() { let a = app::App::default(); let mut win = window::Window::default().with_size(400, 300); let flex = group::Flex::default().with_size(100, 200).column().center_of_parent(); // only one can be toggled by the user at a time, the other will be automatically untoggled let btn1 = button::RadioRoundButton::default().with_label("Option 1"); let btn2 = button::RadioRoundButton::default().with_label("Option 2"); flex.end(); win.end(); win.show(); a.run().unwrap();
} (The focus box can be removed using the clear_visible_focus() method btn1.clear_visible_focus()). image Other toggle-able buttons don't have this property. You can query whether a button is toggled or not using the ButtonExt::value() method: use fltk::{prelude::*, *}; fn main() { let a = app::App::default(); let mut win = window::Window::default().with_size(400, 300); let flex = group::Flex::default().with_size(100, 200).column().center_of_parent(); let btn1 = button::CheckButton::default().with_label("Option 1"); let btn2 = button::CheckButton::default().with_label("Option 2"); let mut btn3 = button::Button::default().with_label("Submit"); flex.end(); win.end(); win.show(); btn3.set_callback(move |btn3| { if btn1.value() { println!("btn1 is checked"); } if btn2.value() { println!("btn1 is checked"); } }); a.run().unwrap();
} CheckButton also provides a convenience method is_checked(), while radio buttons provide an is_toggled(). image By default, toggle-able buttons are created untoggled, however this can be overridden using set_value(), or the convenience methods set_checked() (for CheckButton) and set_toggled() (for radio buttons): use fltk::{prelude::*, *}; fn main() { let a = app::App::default(); let mut win = window::Window::default().with_size(400, 300); let flex = group::Flex::default().with_size(100, 200).column().center_of_parent(); let mut btn1 = button::CheckButton::default().with_label("Option 1"); btn1.set_value(true); // Similarly you can use btn1.set_checked(true) let btn2 = button::CheckButton::default().with_label("Option 2"); let mut btn3 = button::Button::default().with_label("Submit"); flex.end(); win.end(); win.show(); btn3.set_callback(move |btn3| { if btn1.value() { println!("btn1 is checked"); } if btn2.value() { println!("btn1 is checked"); } }); a.run().unwrap();
} image

20.body:
FLTK doesn't have a Label widget. So if you would just like to show text, you can use a Frame widget and give it a label. All widgets takes a label in the ::new() constructor or using with_label() or set_label(): let btn = button::Button::new(160, 200, 80, 30, "Click"); This button has a label showing the text "click". Similarly we can use set_label() or with_label(): let btn = button::Button::default().with_label("Click");
// or
let mut btn = button::Button::default();
btn.set_label("Click"); However, the ::new() constructor takes in reality an optional to a static str, so the following would fail: let label = String::from("Click"); // label is not a static str
let mut btn = button::Button::new(160, 200, 80, 30, &label); You would want to use btn.set_label(&label); in this case. The reason is that FLTK expects a const char * label, which is the equivalent of Rust's &'static str. These strings live in the program's code segment. If you disassemble an application, it would show all these static strings. And since these have a static lifetime, FLTK by default doesn't store them. While using set_label() and with_label() calls FLTK's Fl_Widget::copy_label() method which actually stores the string. You are also not limited to text labels, FLTK has predefined symbols which translate into images: symbols The @ sign may also be followed by the following optional "formatting" characters, in this order: '#' forces square scaling, rather than distortion to the widget's shape. +[1-9] or -[1-9] tweaks the scaling a little bigger or smaller. '$' flips the symbol horizontally, '%' flips it vertically. [0-9] - rotates by a multiple of 45 degrees. '5' and '6' do no rotation while the others point in the direction of that key on a numeric keypad. '0', followed by four more digits rotates the symbol by that amount in degrees. Thus, to show a very large arrow pointing downward you would use the label string "@+92->". Symbols and text can be combined in a label, however the symbol must be at the beginning and/or at the end of the text. If the text spans multiple lines, the symbol or symbols will scale up to match the height of all the lines: ex

