To spawn a native dialog: use fltk::{prelude::*, *}; fn main() { let app = app::App::default(); let mut wind = window::Window::default().with_size(400, 300); let mut btn = button::Button::default() .with_size(80, 30) .with_label("Select file") .center_of_parent(); wind.end(); wind.show(); btn.set_callback(|_| { let mut dialog = dialog::NativeFileChooser::new(dialog::NativeFileChooserType::BrowseFile); dialog.show(); println!("{:?}", dialog.filename()); }); app.run().unwrap();
