FLTK also offers several dialog types which can be conveniently shown using free functions: message alert choice input password (like input but doesn't show the inputted data) To show up a simple message dialog: use fltk::{prelude::*, *}; fn main() { let app = app::App::default(); let mut wind = window::Window::default().with_size(400, 300); let mut btn = button::Button::default() .with_size(100, 30) .with_label("Show dialog") .center_of_parent(); wind.end(); wind.show(); btn.set_callback(|_| { dialog::message_default("Message"); }); app.run().unwrap();
} This shows a message at a default location (basically near the pointer). If you would like to enter coordinates manually, you can use the message() function: btn.set_callback(|_| { dialog::message(100, 100, "Message"); }); All the previously mentioned functions have to variants, one with _default() suffix which doesn't require coordinates, and the other without which requires coordinates. Some dialogs return a value, like choice, input, and password. Input and password return the inputted text, while choice returns an index of the chosen value: use fltk::{prelude::*, *}; fn main() { let app = app::App::default(); let mut wind = window::Window::default().with_size(400, 300); let mut btn = button::Button::default() .with_size(100, 30) .with_label("Show dialog") .center_of_parent(); wind.end(); wind.show(); btn.set_callback(|_| { // password and input also takes a second arg which is the default value let pass = dialog::password_default("Enter password:", ""); if let Some(pass) = pass { println!("{}", pass); } }); app.run().unwrap();
} image An example with choice: use fltk::{prelude::*, *}; fn main() { let app = app::App::default(); let mut wind = window::Window::default().with_size(400, 300); let mut btn = button::Button::default() .with_size(100, 30) .with_label("Show dialog") .center_of_parent(); wind.end(); wind.show(); btn.set_callback(|_| { let choice = dialog::choice_default("Would you like to save", "No", "Yes", "Cancel"); println!("{}", choice); }); app.run().unwrap();
} This will print the index, i.e. choosing No will print 0, Yes will print 1 and Cancel will print 2. image You have noticed that all of these dialogs didn't have a title. You can add a title also using a free function called before the dialog: dialog::message_title("Exit!"); let choice = dialog::choice_default("Would you like to save", "No", "Yes", "Cancel"); You can also set the default title of all these dialog boxes using dialog::message_title_default(), you'll want to do this in the start of your app: use fltk::{prelude::*, *}; fn main() { let app = app::App::default(); dialog::message_title_default("My App!"); let mut wind = window::Window::default().with_size(400, 300); let mut btn = button::Button::default() .with_size(100, 30) .with_label("Show dialog") .center_of_parent(); wind.end(); wind.show(); btn.set_callback(|_| { let choice = dialog::choice_default("Would you like to save", "No", "Yes", "Cancel"); println!("{}", choice); }); app.run().unwrap();
} image

