All these dialogs make assumptions about your app that might not be correct, especially regarding colors and fonts. If you have a heavily customized app you would probably also want custom dialogs. A dialog is basically a modal window which is spawned during the application. This can have the same styling as the rest of your app: use fltk::{ app, button, enums::{Color, Font, FrameType}, frame, group, input, prelude::*, window,
}; fn style_button(btn: &mut button::Button) { btn.set_color(Color::Cyan); btn.set_frame(FrameType::RFlatBox); btn.clear_visible_focus();
} pub fn show_dialog() -> MyDialog { MyDialog::default()
