FLTK recognizes 29 events which are listed in enums::Event. However it allows us to create our own events using the app::handle(impl Into, window) call. The handle function takes an arbitrary i32 (> 30) value as a signal, ideally the values should be predefined, which can be handled within another widget's handle() method, the other widget needs to be within the window that was passed to app::handle. In the following example, we create a window with a frame and a button. The button's callback sends a CHANGED Event through the app::handle_main function. The CHANGED signal is queried in the frame's handle method. use fltk::{app, button::*, enums::*, frame::*, group::*, prelude::*, window::*};
use std::cell::RefCell;
use std::rc::Rc; pub struct MyEvent; impl MyEvent { const CHANGED: i32 = 40;
} #[derive(Clone)]
pub struct Counter { count: Rc<RefCell<i32>>,
} impl Counter { pub fn new(val: i32) -> Self { Counter { count: Rc::from(RefCell::from(val)), } } pub fn increment(&mut self) { *self.count.borrow_mut() += 1; app::handle_main(MyEvent::CHANGED).unwrap(); } pub fn decrement(&mut self) { *self.count.borrow_mut() -= 1; app::handle_main(MyEvent::CHANGED).unwrap(); } pub fn value(&self) -> i32 { *self.count.borrow() }
} fn main() -> Result<(), Box<dyn std::error::Error>> { let app = app::App::default(); let counter = Counter::new(0); let mut wind = Window::default().with_size(160, 200).with_label("Counter"); let mut pack = Pack::default().with_size(120, 140).center_of(&wind); pack.set_spacing(10); let mut but_inc = Button::default().with_size(0, 40).with_label("+"); let mut frame = Frame::default() .with_size(0, 40) .with_label(&counter.clone().value().to_string()); let mut but_dec = Button::default().with_size(0, 40).with_label("-"); pack.end(); wind.end(); wind.show(); but_inc.set_callback({ let mut c = counter.clone(); move |_| c.increment() }); but_dec.set_callback({ let mut c = counter.clone(); move |_| c.decrement() }); frame.handle(move |f, ev| { if ev == MyEvent::CHANGED.into() { f.set_label(&counter.clone().value().to_string()); true } else { false } }); Ok(app.run()?)
} The sent i32 signal can be created on the fly, or added to a const local or global, or within an enum. Advantages: No overhead. The signal is dealt with like any fltk event. the app::handle function returns a bool which indicates whether the event was handled or not. Allows handling of custom signals/events outside the event loop. Allows an MVC or SVU architecture to your application. Disadvantages: The signal can only be handled in a widget's handle method. The signal is inaccessible within the event loop (for that, you might want to use WidgetExt::emit or channels described previously in this page).

