fltk offers timeouts for recurring operations. We can add a timeout, repeat it and remove it: extern crate once_cell;
use fltk::{prelude::*, *}; fn move_button(mut btn: button::Button) { btn.set_size(btn.w() - 2, btn.h()); btn.parent().unwrap().redraw(); if btn.w() == 0 { app::remove_timeout(move || { let btn = btn.clone(); move_button(btn); }); } else { app::repeat_timeout(0.3, move || { let btn = btn.clone(); move_button(btn); }); }
} fn main() { let a = app::App::default(); let mut win = window::Window::default().with_size(400, 300); let mut btn = button::Button::new(0, 0, 100, 300, None); win.end(); win.show(); btn.set_callback(|b| { let btn = b.clone(); app::add_timeout(0.016, move || { let btn = btn.clone(); move_button(btn) }); }); a.run().unwrap();
} We basically add the timeout when the user clicks the button, and depending on the size of the button we either repeat it or remove it.
